    def dfs(start):
        visited = [False] * n
        stack = [(start, 0)]
        result = []
        visited[start] = True

        while stack:
            node, depth = stack.pop()

            if visited[node]:
                continue

            visited[node] = True
            result.append(node)

            for neighbor in edges[node]:
                new_node = neighbor[0]

                if not visited[new_node]:
                    stack.append((new_node, depth + 1))

        return result

    cycles = [set(dfs(i)) for i in range(n)]

    for cycle in cycles:
        if len(cycle) < 3:
            return 0

    return len(cycles)

