def solution(stdin: str) -> str:
    n = int(stdin.readline().strip())
    edges = [list(map(int, stdin.readline().strip().split())) for _ in range(n - 1)]

    def find_vertex(parent, root):
        if root == parent:
            return root
        return find_vertex(parent, parent[root])

    def dfs(parent, root):
        if root == parent:
            return parent[root]

        root_vertex = dfs(parent, parent[root])

        for i in range(len(edges)):
            next_vertex = edges[i][0]
            if parent[root_vertex] == parent[next_vertex]:
                return None

        return root_vertex

    max_cost = 0
    v = None
    for u, v in edges:
        parent = {i: j for i, j in enumerate(parent)}
        root = dfs(parent, u)

        if root is None:
            max_cost += 1
        else:
            parent[root] = v
            v = root

    return max_cost if v is None else max_cost + find_vertex(parent, v)

