        run_length = 1
        for i, char in enumerate(s):
            if char == prev_char:
                run_length += 1
            else:
                if run_length > 1:
                    encoded += f"{run_length}{prev_char}"
                    run_length = 1
                prev_char = char
        if run_length > 1:
            encoded += f"{run_length}{prev_char}"
        return encoded

    def decode_run_length_encoding(s: str) -> str:
        decoded = ""
        prev_char = None
        run_length = 1
        for i, char in enumerate(s):
            if char.isdigit():
                run_length = int(char)
                if prev_char:
                    decoded += prev_char * run_length
            else:
                decoded += char
                prev_char = char
        return decoded

