        x, y = polygon[0]
        for i in range(1, len(polygon)):
            x1, y1 = polygon[i - 1]
            x2, y2 = polygon[i]
            rotated_x = x1 + (x2 - x1) * (x - x1) / (y - y1)
            rotated_y = y1 + (y2 - y1) * (x - x1) / (y - y1)
            polygon[i - 1] = rotated_x, rotated_y
        return polygon

    def shrink_polygon(polygon, A):
        num_points = len(polygon)
        for i in range(num_points - 1):
            x1, y1 = polygon[i]
            x2, y2 = polygon[i + 1]
            area1 = calculate_area(x1, y1, x2, y2)
            area2 = calculate_area(x1, y1, x2, y2)
            if area1 > A or area2 > A:
                return polygon
        return polygon

    def enlarge_polygon(polygon, A):
        num_points = len(polygon)
        for i in range(num_points - 1):
            x1, y1 = polygon[i]
            x2, y2 = polygon[i + 1]
            area1 = calculate_area(x1, y1, x2, y2)
            area2 = calculate_area(x1, y1, x2, y2)
            if area1 < A or area2 < A:
